CREATE DEFINER=`root`@`localhost` PROCEDURE `spPurchaseSelectAll`()
BEGIN
select 
	pur.Id Id,
	pur.CustomerId ,
	cus.Phone ,
	cus.Address,
	cus.Name,
	pur.CreatedDate,
	pur.Type,
	pur.Weight,
	pur.PriceId,
	pur.Price,
	pur.PayNow,
	pur.MuType,
	case 
	when pur.MuType = 2
	 then "Mủ dây"
	when pur.MuType = 1
	 then "Mủ chén"
	when pur.MuType = 0
	 then "Mủ nước"
	else ""
	end MuTypeName,
	pur.Degree,
	pur.Note,
	pur.PaidDate
 from purchaseinfo pur inner join customerinfo cus on pur.CustomerId = cus.Id 
where Date(pur.CreatedDate) = curdate() and Actived = 1
order by pur.Id desc;
END ;;
DELIMITER ;
